import React from 'react';
import { Route, Switch } from 'react-router-dom';

import Fullstory from './FullStory';
import Stories from './Stories';
function Routes() {
  return (
    <div>
      <Switch>
        <Route path='/stories'>
          <Stories />
        </Route>
        <Route path='/fullstory/'>
          <Stories />
        </Route>
      </Switch>
    </div>
  );
}

export default Routes;
